const PatientReg = () => {
  return (
    <div>
      <form>
            <h4 className="opacity-75">Patient Registration</h4>
            <form className="col-sm-2">
                <p className="opacity-50">First Name</p>
                <input className="form-control" type="text" placeholder="Enter First Name" />
                <br/>
                <p className="opacity-50">Last Name</p>
                <input className="form-control" type="text" placeholder="Enter Last Name" />
                <br/>
                <p className="opacity-50">Doctor Password</p>
                <input className="form-control" type="password" placeholder="Enter Password" /><br/>
                <div>
                    <button type="Submit" className="btn btn-primary">SUBMIT</button>
                </div>                               
            </form>          
            </form>



    </div>
  );
};

export default PatientReg;

